import React from 'react';

class AutoCompleteText extends React.Component {
    constructor (props) {
        super(props);
        this.items = [
            'Fris',
            'Dani',
            'Hey',
            'Ho'
        ]
        this.state = { module: null,
                       suggestions: []
                     };
    }

    render () {
        return (
            <div>
                <input onChange={this.handleChange}
                       type="text" />
                <ul>
                    {this.items.map((item) => <li>(item)</li>)}
                </ul>
            </div>
        )
    }
}
